import React from 'react'

function Breakfast() {
    return (

        <div className="card">
            <img src="./components/images/item-1.jpeg" alt="Resim" className="card-img" />
            <div className="card-content">
                <h2>Başlık</h2>
                <p>İçerik</p>

            </div>
        </div>
    )
}

export default Breakfast
